('hybrid_auth', 'Đăng nhập bằng mạng xã hội', 'Cho biết thêm các tính năng đăng nhập sử dụng tài khoản mạng xã hội; cho phép khách hàng sử dụng Facebook, Twitter, vv để đăng nhập vào cửa hàng', 'vi'),
