('vi', 'browser_upgrade_notice', '<p>Chúng tôi đã phát hiện rằng trình duyệt bạn đang sử dụng không hoàn toàn được hỗ trợ bởi bảng quản trị của chúng tôi. Bạn có thể xem trang web này bằng cách sử dụng trình duyệt hiện tại của bạn nhưng nó có thể không hiển thị đúng, và bạn không thể sử dụng đầy đủ tất cả các tính năng.</p> <br><p>Bảng quản trị tốt nhất xem bằng cách sử dụng các trình duyệt sau:</p> <br><ul><li>-<a href=\"http://windows.microsoft.com/en-US/internet-explorer/products/ie/home\" target=\"_blank\"> Internet Explorer 9 trở lên</a></li> <li>-<a href=\"http://www.mozilla.org/en-US/\" target=\"_blank\"> Mozilla Firefox (Phiên bản mới nhất)</a></li> <li>-<a href=\"https://www.google.com/intl/en/chrome/browser/\" target=\"_blank\"> Google Chrome (Phiên bản mới nhất)</a></li></ul> <br><p>Click vào một trong các liên kết để tải về trình duyệt của bạn lựa chọn. Khi việc tải xuống đã hoàn tất, cài đặt trình duyệt bằng cách chạy chương trình cài đặt.</p> <br><p>Nếu bạn không thể nâng cấp trình duyệt của bạn bây giờ, bạn vẫn có thể truy cập vào bảng quản trị, nhưng bạn không thể sử dụng đầy đủ tất cả các tính năng. <br> <br><a href=\"[url]\"> tiếp tục</a></p>'),
