('vi', 'C128A', 'Mã số 128 là một mã vạch mật độ cao. <br/> Được sử dụng rộng rãi trên toàn thế giới. <br/> Mã số 128 được thiết kế để mã hóa ký tự ASCII đầy đủ 128. <br/> Mã 128-A - 0-9, A-Z, ASCII kiểm soát mã ký tự đặc biệt. <br/> Mã số 128-B-0-9, ký tự A-Z a-z, ký tự đặc biệt. <br/> Mã số 128-C-00-99 (mật độ gấp đôi mã hóa dữ liệu chỉ có số). <br/>'),
