('vi', 'terms_and_conditions_content', '<p>Xin vui lòng đọc các Điều khoản và Điều kiện (\"Điều khoản\", \"Điều khoản và Điều kiện\") một cách cẩn thận trước khi sử dụng các trang web <a href=\"http://www.mywebsite.com\"> http://www.mywebsite.com</a> và các ứng dụng điện thoại di động của tôi sử dụng ứng dụng di động (\"Dịch vụ\") do công ty của tôi (\"chúng tôi\").</p> <p><strong>Bằng cách truy cập hoặc sử dụng các dịch vụ là bạn đồng ý bị ràng buộc bởi các điều khoản này. Nếu bạn không đồng ý với bất kỳ phần nào của các điều khoản, bạn có thể không truy cập vào Dịch vụ.</strong></p> <p><strong>Mua hàng</strong></p> <p>Nếu bạn muốn mua bất kỳ sản phẩm hay dịch vụ cung cấp thông qua dịch vụ (\"Mua hàng\"), bạn có thể được yêu cầu cung cấp một số thông tin có liên quan đến bạn.</p> <p><strong>Nội dung</strong></p> <p>Dịch vụ của chúng tôi cho phép bạn đăng bài, liên kết, lưu trữ, chia sẻ và nếu không làm cho có sẵn một số thông tin, văn bản, đồ họa, video hoặc các vật liệu khác (\"nội dung\"). Bạn chịu trách nhiệm các...</p> <p><strong>Thay đổi</strong></p> <p>Chúng tôi có quyền, theo ý kiến của chúng tôi để sửa đổi hoặc thay thế các điều khoản này bất kỳ lúc nào. Nếu một phiên bản là vật liệu chúng tôi sẽ cố gắng cung cấp cho ít nhất 30 ngày thông báo trước khi bất kỳ điều khoản mới tham gia có hiệu lực. Những gì tạo một thay đổi quan trọng sẽ được xác định theo ý kiến của chúng tôi.</p> <p><strong>Liên hệ với chúng tôi</strong></p> <p>Nếu bạn có bất kỳ câu hỏi nào về các điều khoản, xin vui lòng liên hệ.</p>'),
