('vi', 'text_amazon_callback_url', 'Quan trọng! Bạn phải chỉ định cửa hàng của bạn URL <b>[callback_url]</b> là URL Thương Gia trên Trang Amazon\'s Seller Central (Settings > Checkout Pipeline Settings). Nếu không, bạn sẽ không thể chấp nhận thanh toán thông qua Amazon Checkout trong cửa hàng của bạn'),
('vi', 'text_amazon_failed_order', 'Không có phản ứng từ Amazon Checkout đã nhận được hay chưa, xin vui lòng chờ. Mặc dù đơn hàng có thể không được tạo ra trong cửa hàng, có thể nó đã được tạo thành công và xử lý bởi Amazon Checkout. Xin vui lòng liên hệ với nhân viên cửa hàng và nói với họ ID đơn đặt hàng theo quy định của Amazon'),
