('vi', 'text_are_you_sure_to_proceed', 'Bạn có chắc bạn muốn tiếp tục không?'),
('vi', 'text_atos_notice', '<b>Lưu ý:</b> < br /> 1. Bản sao chứng chỉ của bạn mà bạn nhận được trên ổ đĩa vào thư mục [home_path]. Đổi tên trong giấy chứng nhận thành certif.fr.[my_merchant_id], trong đó [my_merchant_id] là số trang web của bạn. < br> 2. Đổi tên tập tin thông số cửa hàng (parmcom.014213245611111 tập tin) parmcom.[my_merchant_id].<br / > 3. Chỉnh sửa file <b>pathfile</b> trong thư mục <b>[home_path]</b> < br / >-thay thế dây \' <u>D_LOGO![some_dir]!</u>\' với \' <u>D_LOGO![http_path]/logo /!</u>\' < br / >-Ghi đè chuỗi \' <u>F_DEFAULT! [ / some_dirs/parmcom.sogenactif]!</u>\' với \' <u>F_DEFAULT![home_path]/parmcom.sogenactif!</u>\' < br / >-Ghi đè chuỗi \' <u>F_PARAM! [ / some_dirs/parmcom]!</u>\' với \' <u>F_PARAM! [home_path]/parmcom!</u>\' < br / >-tGhi đè chuỗi \' <u>F_CERTIFICATE! [ / some_dirs/certif]!</u>\' với \' <u>F_CERTIFICATE! [home_path]/certif!</u>\' < br / > 4. Chỉnh sửa file <b>parmcom.[some_number]</b> trong thư mục <b>[home_path]</b> < br / >-Ghi đè chuỗi \' <u>AUTO_RESPONSE_URL![some_url]!</u>\' với \' <u>AUTO_RESPONSE_URL![auto_url]!</u>\' < br / >-Ghi đè chuỗi \' <u>CANCEL_URL! [some_url]!</u>\' với \' <u>CANCEL_URL![ok_url]!</u>\' < br / >-Ghi đè chuỗi \' <u>RETURN_URL! [some_url]!</u>\' với \' <u>RETURN_URL! [ok_url]!</u>\' < br / >'),
('vi', 'text_atos_warning', '<span style=\"color:#FF2222\"> Cảnh báo!</span> Đường dẫn đến tập tin atos nên bao gồm các biểu tượng không quá 60 ký tự, nếu không xin vui lòng sao chép thư mục atos_files vào một thư mục cha, ví dụ như vào thư mục giỏ hàng lõi. Cũng xin vui lòng chắc chắn rằng thư mục tập tin atos có đầy đủ quyền ghi.'),
('vi', 'text_authentication_failed_message', 'Tổ chức tài chính của bạn đã chỉ ra rằng nó có thể không  xác nhận thành công của giao dịch này. Để bảo vệ chống sử dụng trái phép, thẻ này không thể được sử dụng để hoàn thành mua hàng của bạn. Bạn có thể hoàn thành việc mua bằng cách chọn một hình thức thanh toán khác.'),
