('vi', 'text_datatrans_notice', '<b>Lưu ý</b>: Để theo dõi các đơn đặt hàng DataTrans với mua sắm giỏ hàng phần mềm bạn có thể làm theo các bước sau: < br /> < br />-Đăng nhập vào tài khoản DataTrans của bạn < br / >-Nhấp vào liên kết <u>\' Upp dữ liệu \'</u> trong phần <u>\' Upp quản trị \'</u>. < br / > - Set <u>\'Định dạng dữ liệu URL bài\'</u> để <b>\'Dữ liệu dưới dạng HTML\'</b>. < br / > - thiết lập <u>\' URL đăng bài \'</u>: < br / > <b>[post_url]</b> < br / >-nhấp vào liên kết <u>\'Bảo mật\'</u> trong phần <u>\' Upp quản trị \'</u>. < br / > - chọn Các <b>\'một nhận dạng bán bổ sung sẽ là gửi với các khoản thanh toán thư\'</b> tùy chọn. < br / >-tạo mới chữ ký điện tử bằng cách sử dụng nút <u>\'Tạo mới ký\'</u>. < br / >-thiết lập tạo ra giá trị trong lĩnh vực <u>\'Kỹ thuật số chữ ký\'</u> trên trang cấu hình thanh toán DataTrans trong cửa hàng của bạn < br />'),
('vi', 'text_data_changed', 'Thay đổi của bạn chưa được lưu. Bấm OK để tiếp tục, hoặc hủy bỏ để ở lại trên trang hiện tại.'),
('vi', 'text_decrease_points_in_use', 'Điểm được sử dụng theo đươn hàng được trừ từ tài khoản người dùng.'),
('vi', 'text_deltapay_notice', '<b>Lưu ý:</b> Xin vui lòng gửi các thông tin sau để hỗ trợ DeltaPay: <br /> Trang thanh toán: \' <u>[payment_url]\'</u> <br /> Trang thành công: \' <u>[result_url]\'</u> <br / > Trang thất bại: \' <u>[result_url]\'</u> <br /> Trang hủy bỏ: \' <u>[result_url]\'</u> <br />'),
('vi', 'text_directebanking_notice', 'Đặt \'Liên kết thành công\': <b>[success_url]</b> < br /> Đặt \'Liên kết hủy bỏ\': <b>[abort_url]</b> < br /> Thêm thông báo mới của HTTP và thiết lập \'Thông báo URL\': <b>[notification_url]</b> < br /> Kích hoạt kiểm tra đầu vào và thiết lập \'Thuật toán Hash\' để \'SHA1\' < br />'),
