('vi', 'text_editing', 'Chỉnh sửa văn bản'),
('vi', 'text_edp_product', 'Sản phẩm này phân phối trực tuyến và có thể tải về'),
('vi', 'text_ekey_not_valid', 'Liên kết xác nhận là không hợp lệ hoặc đã hết hạn.'),
