('vi', 'text_emerchantpay_notice', 'Xin vui lòng thêm các trường URL trong eMerchantPay eCommerce Payment Form của bạn: <br/> <br/> <b>BackReturn URL:</b> <br/>[backreturn_url] <br/> <br/> <b>Custom Approval URL:</b> <br/>[notify_url] <br/> <br/> <b>Custom Decline URL:</b> <br/>[decline_url] <br/> <br/> <b>Activate Notification URL:</b> <br/>[process_url]'),
('vi', 'text_enets_notice', 'Xin vui lòng gửi URL sau đây cho người quản lý eNPS là một phản ứng URL cho tất cả các trường hợp ba (thành công, thất bại, hủy bỏ): [r_url]'),
('vi', 'text_enter_filename', 'Xin vui lòng nhập tên tập tin mới'),
('vi', 'text_exim_data_exported', 'Dữ liệu được xuất thành công'),
('vi', 'text_exim_data_imported', 'Dữ liệu được nhập thành công. <br /> Các đối tượng mới - <b>[new]</b>; <br /> Cập nhật các đối tượng - <b>[exist]</b>; <br /> Bỏ qua các đối tượng - <b>[skipped]</b>; <br /> Tổng số - <b>[total]</b>.'),
