('vi', 'text_exim_export_notice', 'Dưới đây là danh sách các mục có thể được xuất dữ liệu. Các mục <b>được đánh dấu</b> là không bắt buộc.');
INSERT INTO `cscart_language_values` (`lang_code`, `name`, `value`) VALUES
('vi', 'text_exim_import_features_note', '<h4>Product features import format</h4><code>(%Group name%) %Feature name%: %Feature type%[%Feature value%]</code>where,<dl class=\"dl-horizontal\"><dt>%Group name%</dt><dd>the name of feature group</dd><dt>%Feature name%</dt><dd>the name of feature</dd><dt>%Feature type%</dt><dd>the feature type (C - checkbox, M - multiple checkboxes, S - text select box, N - number select box, E - extended selectbox, T - simple text, O - number, D - date)</dd><dt>%Feature value%</dt><dd>the feature value (several values can be delimited by comma)</dd></dl><p>Several features must be delimited by semicolon.</p><h5>Example:</h5><code>ISBN: T[1233423423]; Release date: D[05/05/07]; Color: S[Red]</code>'),
('vi', 'text_exim_import_files_note', '<h4>Định dạng tập tin nhập vào</h4> <code>%File location%</code> ở đâu, <dl class=\"dl-horizontal\"> <dt>%File location%</dt> <dd>có thể có một đường dẫn tuyệt đối hoặc tương đối trong hệ thống tập tin máy chủ hoặc một URL</dd></dl> <p>một số tập tin phải được phân cách bằng dấu phẩy.</p> <h5>Ví dụ 1:</h5> <code>File1.jpg</code> <h5>Ví dụ 2:</h5> <code>Backup/File1.zip, images/file2.jpg</code>'),
('vi', 'text_exim_import_images_note', '<h4>Định dạng hình ảnh nhập vào</h4> <code>%Image location% #%Alternative text%</code> ở đâu, <br><dl class=\"dl-horizontal\"> <dt>%Image location%</dt> <dd>có thể có một đường dẫn tuyệt đối hoặc tương đối trong hệ thống tập tin máy chủ hoặc một URL,</dd> <dt>%Alternative text% <dt><dd>văn bản thay thế hình ảnh</dd></dl><h5>ví dụ 1:</h5><code>images/product_images/apples.jpg#Apples</code><h5>ví dụ 2:</h5><code>http://www.site.com/apples.jpg#Apples</code>'),
('vi', 'text_exim_import_notice', 'Dưới đây là danh sách các trường có thể chứa các tập tin dữ liệu của bạn. Các trường được đánh dấu đậm là bắt buộc. Nếu bạn đang nhập dữ liệu với ký hiệu đặc biệt (dấu phẩy, dấu chấm phẩy, vv), xin vui lòng chắc chắn rằng bạn có các lĩnh vực trích dẫn.'),
('vi', 'text_exim_import_options_note', '<h4>Product options import format</h4><code>%Option name%: %Option type%[{$ldelim}%Variant 1 ID%{$rdelim}%Variant 1%,{$ldelim}%Variant 2 ID%{$rdelim}%Variant 2%,{$ldelim}%Variant N ID%{$rdelim}%Variant N%]</code> where,<dl class=\"dl-horizontal\"><dt>%Option name%</dt><dd>the name of the option,</dd><dt>%Variant N ID%</dt><dd>the id of the variant,</dd><dt>%Variant N%</dt><dd>the name of the variant. Variants must be specified if the option type is a selectbox or radiogroup only.</dd><dt>%Option type%</dt><dd>the option type, can be the following:<br><ul><li><b>S</b> - selectbox,</li><li><b>R</b> - radiogroup,</li><li><b>C</b> - checkbox,</li><li><b>I</b> - simple input,</li><li><b>T</b> - textarea.</li></ul></dd></dl><p>Several options must be delimited by semicolon.</p><h5>Examples:</h5>Simple text options:<code>Your age: I; Date of birth: I; Notes: T</code><br>Options with variants:<code>Color: S[Red, Green, Blue]; Size: R[X, XL, XXL]</code>'),
('vi', 'text_exim_utf8_file_format', 'Xin vui lòng đảm bảo rằng các tập tin bạn đang nhập có bộ ký tự UTF-8 cho nhập dữ liệu chính xác'),
('vi', 'text_expired_license', 'Thật không may, đăng ký để nhận tin cho sản phẩm [product] đã quá hạn. Xin vui lòng làm mới nó càng sớm càng tốt để tránh bị đình chỉ chương trình.'),
('vi', 'tmpl_text_fancybox', 'FancyBox'),
('vi', 'text_features_delimiter', 'Phân tách giữa các giá trị biến thể của một tính năng sản phẩm.'),
('vi', 'text_feedback_notice', 'Các thông số sẽ được gửi đến máy chủ của chúng tôi để phân tích các chức năng và cấu hình hiện tại được liệt kê dưới đây. <br /> Xin lưu ý rằng thông tin cá nhân hoặc tài chính sẽ không được gửi. Sau khi bạn kiểm tra với danh sách các tham số, bấm vào \"Gửi\". <br />'),
('vi', 'text_files_directory', 'Thư mục mà tập tin sản phẩm được đặt. Điều này sẽ được sử dụng nếu dữ liệu trường \"Tập tin\" được chỉ định mà không có một đường dẫn.'),
('vi', 'text_file_created', 'Tập tin <b>[file]</b> đã được tạo thành công'),
('vi', 'text_file_deleted', 'Tập tin <b>[file]</b> đã được xóa thành công'),
('vi', 'text_file_renamed', 'Tập tin <b>[file]</b> đã được đổi tên thành <b>[to_file]</b>'),
('vi', 'text_file_restored', 'Tập tin <b>[file]</b> đã được khôi phục từ kho lưu trữ'),
('vi', 'text_file_saved', 'Tập tin <b>[file]</b> được lưu thành công'),
('vi', 'text_fill_the_mandatory_fields', 'Bạn cần phải hoàn thành tất cả các trường bắt buộc'),
('vi', 'text_forbidden_file_extension', 'Nó không được cho phép để tạo/tải lên/đổi tên tập tin với phần mở rộng <b>.[ext]</b>.'),
('vi', 'text_forbidden_file_mime', 'Nó không được cho phép để tạo/tải lên/đổi tên tập tin của loại MIME <b>[mime]</b>.'),
('vi', 'text_forbidden_functionality', '<p>Để sử dụng tính năng này, bạn cần một giấy phép [product].</p>'),
('vi', 'upgrade_license', 'Giấy phép nâng cấp'),
('vi', 'text_forbidden_uploaded_file_extension', 'Nó không được cho phép để tải lên các tập tin với phần mở rộng <b>.[ext]</b>. Cho phép Tiện ích mở rộng: <b>[exts]</b>'),
('vi', 'text_forbidden_uploaded_file_size', 'Nó không được cho phép để tải lên các tập tin với kích thước lớn hơn <b>[size]</b>'),
('vi', 'text_license_required_full', 'Ấn bản CS-giỏ hàng hiện tại của bạn là chuyên nghiệp. Chúng tôi cũng cung cấp một số khác, một phiên bản tiên tiến hơn-<b>cuối cùng</b>. Với CS-Cart cuối cùng, bạn sẽ có thể sử dụng không giới hạn số lượng storefronts và các ứng dụng thương mại điện tử di động cũng như eBay đồng bộ hóa tiện ích và ứng dụng Facebook mà không cần lệ phí bổ sung. Để mở khóa không giới hạn storefonts và điện thoại di động thương mại, nhận được giấy phép cuối cùng.'),
('vi', 'text_license_required_storefronts', 'Thêm nhiều cửa hàng bạn muốn và quản lý chúng thông qua một bảng quản trị duy nhất.'),
('vi', 'text_license_required_mobile', 'Quản lý cửa hàng thuận tiện on-the-go thông qua điện thoại di động của bạn.'),
('vi', 'text_license_required_facebook', 'Xây dựng các cửa hàng vào trang Facebook của bạn để gần gũi hơn với đối tượng của bạn và thu hút thêm khách hàng mới.'),
('vi', 'text_license_required_ebay', 'Đẩy mạnh việc bán hàng của bạn bằng cách bán các sản phẩm được trình bày trong cửa hàng CS-Cart của bạn trên thị trường lớn nhất thế giới-eBay.'),
('vi', 'text_form_cresecure_notice', 'Xin vui lòng hoàn thành thanh toán của bạn dưới đây. <br /> Đây là một trang thanh toán an toàn, phục vụ từ một vị trí an toàn.'),
