('vi', 'upgrade_center.upgrades_are_not_available_in_trial', 'Nâng cấp chỉ có sẵn trong chế độ <strong>Đầy đủ</strong> và <strong>Miễn phí</strong>. <br /> <br /> Chế độ cấp giấy phép có thể được thay đổi trong Cài đặt → <a class=\"cm-dialog-opener cm-dialog-auto-size\" data-ca-target-id=\"store_mode_dialog\"> Chế độ cấp phép</a>.'),
