('vi', 'upgrade_center.warning_msg_upgrade_is_complicated', 'Việc nâng cấp là một quá trình phức tạp. Nó có thể không thành công do lý do ngoài tầm kiểm soát của chúng tôi. <br>Để thực hiện nâng cấp cửa hàng của bạn an toàn hơn, chúng tôi đã chuẩn bị lời khuyên cho bạn:'),
