('vi', 'upgrade_center.warning_msg_third_party_add_ons', 'Việc nâng cấp không cập nhật các add-on của bên thứ ba. Đó là lý do tại sao chúng tôi đề nghị bạn vô hiệu hóa tất cả các add-on bên thứ ba trước khi nâng cấp.'),
('vi', 'upgrade_center.warning_msg_test_local', 'Nâng cấp bản sao thử nghiệm cửa hàng của bạn trước để đảm bảo rằng việc nâng cấp sẽ được thông suốt.'),
('vi', 'upgrade_center.warning_msg_after_upgrade', 'Sau khi nâng cấp, kiểm tra các chức năng cơ bản của cửa hàng của bạn.'),
('vi', 'upgrade_center.warning_msg_generally', 'Nói chung, nâng cấp thất bại vì thực hiện kịch bản PHP chấm dứt do cấu hình máy chủ của bạn. Nó là điều cần thiết để kiểm tra các kịch bản PHP thời gian chờ cài đặt trên máy chủ của bạn'),
('vi', 'upgrade_center.warning_msg_timeout_fail', 'Chúng tôi KHÔNG khuyên bạn nên bắt đầu nâng cấp trên máy chủ của bạn.'),
('vi', 'upgrade_center.warning_msg_timeout_check_failed', 'Máy chủ của bạn đã thiết lập thời gian chờ kịch bản PHP sai. Điều này có thể do hạn chế về chức năng PHP <a href=\"http://php.net/manual/en/function.set-time-limit.php\" target=\"_blank\"> set_time_limit</a> hoặc FastCGI \"Timeout\" tùy chọn. Chúng tôi đề nghị bạn liên hệ với nhà cung cấp hosting của bạn để giải quyết vấn đề này hoặc liên hệ với nhóm hỗ trợ công nghệ của chúng tôi để thực hiện nâng cấp cho bạn.'),
('vi', 'upgrade_center.warning_msg_executed_php', '<p class=\"text-error\">Chúng tôi đã bắt đầu một kịch bản PHP giả. Nó sẽ làm việc trong 6 phút. Khi kiểm tra xong, chúng tôi sẽ cho bạn biết nếu kịch bản PHP Timeout được thiết lập một cách chính xác. Nếu có, bạn có thể đi tới nâng cấp. Xin vui lòng chờ đợi cho đến khi kiểm tra xong để chắc chắn rằng máy chủ của bạn có đúng cấu hình PHP Timeout.</p>'),
