('vi', 'uc_restore_email_body', '<p>Cơ sở dữ liệu cửa hàng của bạn và tập tin đã được sao lưu trước khi nâng cấp. Lưu trữ dự phòng bao gồm toàn bộ cơ sở dữ liệu và tất cả các tập tin ngoại trừ hình ảnh. Sao lưu lưu trữ đã được lưu trữ trên máy chủ của bạn: [backup_file].</p> <p>Trước khi nâng cấp, cửa hàng của bạn đã được đóng lại. Kiểm tra nếu nó đang chạy tốt sau khi nâng cấp và <a href=\"[settings_section]\">mở nó</a>.</p> <p>Nếu một điều gì đó đi sai trong quá trình nâng cấp, đi đến bảng quản trị của bạn, <strong>Quản trị → Sao lưu/Khôi phục lại</strong>, để khôi phục bản sao lưu.</p> <p>Nếu bạn không thể truy cập vào bảng quản trị của bạn, sử dụng liên kết sau đây để khôi phục lại sao lưu lần cuối. <b>Quan trọng:</b> theo liên kết này ngay lập tức sẽ khởi động quá trình khôi phục. Chỉ sử dụng nó nếu bạn không thể truy cập vào bảng quản trị cửa hàng! Khôi phục sao lưu cuối:</p>'),
