('vi', 'use_for_free_shipping', 'Sử dụng miễn phí vận chuyển'),
('vi', 'tt_views_products_components_products_shipping_settings_free_shipping', 'Các sản phẩm với tùy chọn vận chuyển miễn phí cho phép sẽ được loại trừ khỏi tính toán vận chuyển nếu phương pháp vận chuyển có sử dụng tùy chọn vận chuyển miễn phí kích hoạt'),
('vi', 'tt_views_shippings_update_use_for_free_shipping', 'Loại trừ sản phẩm với các tùy chọn được kích hoạt miễn phí vận chuyển từ việc tính toán giá vận chuyển'),
('vi', 'free_shipping_upgrade_notification_text', '<p>Một số sản phẩm của bạn có các tài sản <b>miễn phí vận chuyển</b> được kích hoạt. Trong các phiên bản trước của [product] một khách hàng không phải chọn một phương pháp vận chuyển khi mua các sản phẩm.</p> <p>Bắt đầu với phiên bản này [product], một khách hàng lựa chọn một phương pháp vận chuyển lúc thanh toán cho các sản phẩm với bất động sản <b>Miễn phí vận chuyển</b> được kích hoạt.</p> <p>Để thiết lập một phương pháp vận chuyển sẽ được sử dụng miễn phí vận chuyển, hoàn thành các bước sau:</p> <ol><li>Đi đến <b>Quản trị → Vận chuyển và thuế → Phương thức vận chuyển</b>.</li> <li>Lựa chọn phương pháp hiện tại mà bạn muốn sử dụng để miễn phí vận chuyển, hoặc tạo ra một hình thức mới.</li> <li>Di chuyển đến phần <i>phụ</i> và kích hoạt các thiết lập <b>sử dụng miễn phí vận chuyển</b>.</li></ol> <p>Bạn có thể thiết lập như phương pháp vận chuyển nhiều như bạn muốn cho miễn phí vận chuyển.</p> <p>Lưu ý rằng bạn phải áp dụng tuỳ chọn <b>sử dụng miễn phí vận chuyển</b> cho các phương pháp vận chuyển đặc biệt.</p> <p>Đánh dấu vào hộp kiểm <b>sử dụng miễn phí vận chuyển</b>, nếu bạn muốn loại trừ các sản phẩm với các kích hoạt tùy chọn <b>vận chuyển miễn phí</b> từ giá tính toán. [product] vận chuyển sẽ tính toán giá vận chuyển các sản phẩm khác từ lúc nhận hàng phù hợp với <b>chi phí vận chuyển</b>.</p> <p>Nếu bạn để lại hộp kiểm unticked, [product] sẽ tính toán giá vận chuyển cho tất cả các sản phẩm từ lúc nhận hàng phù hợp với <b>chi phí vận chuyển</b>.</p>'),
