('vi', 'dhl_upgrade_notification_title', 'Thời gian thực DHL vận chuyển tỷ lệ tính toán thay đổi'),
('vi', 'dhl_upgrade_notification_text', '<p>Phiên bản mới nhất của [product] có các cài đặt khác nhau cho thời gian thực vận chuyển tính toán tỷ lệ nếu bạn sử dụng DHL là một tàu sân bay.</p> <p>Nếu bạn muốn hiển thị giá vận chuyển hiện tại khách hàng của bạn, làm điều này:</p> <ul><li>đi đến chính quyền > vận chuyển & thuế > vận chuyển phương pháp</li> <li>chọn phương pháp vận chuyển có sử dụng DHL là một tàu sân bay để tính toán vận chuyển tỷ giá</li> <li>chuyển sang General tab và nhập vào các dịch vụ vận chuyển thích hợp</li> <li>chuyển sang tab cấu hình và nhập thích hợp trang web ID và mật khẩu</li></ul>'),
('vi', 'upgrade_notification_title', 'Nâng cấp các thay đổi trong [product] [version]'),
('vi', 'eway_upgrade_notification_title', 'eWAY, eWAY Direct Payment và eWAY Shared Payment không còn được hỗ trợ'),
('vi', 'eway_upgrade_notification_text', '<p><b>eWAY</b>, <b>eWAY Direct Payment</b> và <b>eWAY Shared Payment</b> không được hỗ trợ kể từ phiên bản này [product].</p> <p>Chúng tôi đề nghị bạn <b>nâng cấp lên eWAY Direct Payment (Rapid API)</b> hoặc <b>eWAY Responsive Shared (Rapid API)</b>, đây là hướng dẫn:</p> <ul><li>đi đến Quản trị > Phương thức thanh toán</li> <li>mở một trong các phương thức thanh toán bằng cách sử dụng deprecated eWAY xử lý</li> <li>chuyển sang tab Chung và chỉ định eWAY Direct Payment (Rapid API) hoặc eWAY Responsive Shared (Rapid API) xử lý thanh toán</li> <li>chuyển sang tab Cấu hình và xác định đúng: <ul><li>khóa API, mật khẩu API và khoá mật mã cho eWAY Direct Payment (Rapid API)</li> <li>khóa API và mật khẩu API cho eWAY Responsive Shared (Rapid API)</li></ul></li></ul> <p>eWAY, eWAY Direct Payment và eWAY Shared Payment vẫn sẽ hoạt động nhưng chúng tôi <b>đã đổi tên</b> họ Deprecated eWAY, Deprecated eWAY Direct Payment và Deprecated eWAY Shared Payment cho phù hợp.</p>'),
('vi', 'eway_configuration_note', '<a href=\'https://go.eway.io/s/article/How-do-I-setup-my-Live-eWAY-API-Key-and-Password\' target=\'_blank\'>Làm thế nào để thiết lập Live eWAY API Key và Mật khẩu?</a>'),
('vi', 'show_more', 'Hiển thị thêm'),
('vi', 'show_less', 'Hiển thị ít hơn'),
('vi', 'products_moved_to_trash', '[count] sản phẩm đã được chuyển đến <a href=\'[url]\' target=\'_blank\'> Danh mục rác</a>'),
('vi', 'products_adopted', '[n] product had a new main category assigned to it.|[n] products had a new main category assigned to them.'),
('vi', 'feature_comparison_upgrade_notification_title', 'Những thay đổi trong tính năng so sánh'),
('vi', 'feature_comparison_upgrade_notification_text', '<b>So sánh tính năng</b> hộp kiểm dưới <b>sản phẩm → sản phẩm → &lt; mong muốn sản phẩm &gt;</b> đã được gỡ bỏ. <br>Bằng cách đánh dấu hộp kiểm <b>cho phép khách hàng để so sánh các sản phẩm</b> mới theo Settings → General → danh mục, bạn có thể bây giờ cho phép khách hàng của bạn để thêm bất kỳ sản phẩm trong cửa hàng của bạn vào danh sách so sánh. <br>Để hiển thị một danh sách so sánh, một tính năng phải có một (hoặc nhiều) của các hộp kiểm cho phép dưới <b>sản phẩm → tính năng → &lt; mong muốn tính năng &gt;</b>: <br><ul><li>Hiển thị trên tab tính năng</li> <li>Hiển thị trong danh sách sản phẩm</li> <li>Hiển thị trong các tiêu đề trên trang chi tiết sản phẩm</li></ul>'),
