('vi', 'canada_post_upgrade_notification_title', 'Canada Post thời gian thực vận chuyển tỷ lệ tính toán thay đổi'),
('vi', 'canada_post_upgrade_notification_text', '<p>Phiên bản mới nhất của [product] có các cài đặt khác nhau cho thời gian thực vận chuyển tính toán tỷ lệ nếu bạn sử dụng Canada Post như một Nhà vận chuyển.</p> <p>Nếu bạn muốn hiển thị giá vận chuyển hiện tại khách hàng của bạn, làm điều này:</p> <ul><li>đi đến Quản trị > Vận chuyển & thuế > Phương thức vận chuyển</li> <li>chọn phương pháp vận chuyển có sử dụng Canada Post như một nhà vận chuyển để tính toán tỷ giá vận chuyển</li> <li>chuyển sang tab Chung và nhập vào các dịch vụ vận chuyển thích hợp</li> <li>chuyển sang tab Cấu hình và nhập thích hợp <a href=\"https://www.canadapost.ca/cpo/mc/business/productsservices/developers/services/gettingstarted.jsf\" target=\"_blank\"> API phím</a></li></ul>'),
