('vi', 'storefronts_limit_exceeded', 'Số lượng các cửa hàng trong giấy phép CS-Cart của bạn đã vượt quá số lượng giấy phép mua cửa hàng.'),
('vi', 'licensed_product', 'Sản phẩm được cấp phép'),
('vi', 'store_mode.ultimate', 'Ultimate'),
('vi', 'product_state_description.ult.new', '<p>Bạn có thể sử dụng một trong các giấy phép: <a href=\"[standard_license_url]\" target=\"_blank\">[product]</a> hoặc <a href=\"[ultimate_license_url]\" target=\"_blank\"> [product] Ultimate</a>. Cả hai giấy phép cho phép bạn sử dụng [product] mà không có thời gian hạn chế.</p> <br>'),
('vi', 'product_state_description.ult', '<p>Bạn đã kích hoạt [product] của bạn. Bây giờ bạn có thể sử dụng nó mà không hạn chế thời gian. Để có thể thêm một số lượng không giới hạn các cửa hàng phụ và quản lý các cửa hàng của bạn thông qua một ứng dụng điện thoại di động, có được những <a href=\"[ultimate_license_url]\" target=\"_blank\"> giấy phép Ultimate [product].</a></p> <br>'),
('vi', 'product_state_description.ult.ultimate', '<p>Bạn đã kích hoạt [product] Ultimate của bạn. Bạn có thể sử dụng nó mà không hạn chế thời gian bây giờ. Với [product] Ultimate, bạn sẽ có được tất cả các tính năng thương mại điện tử tiên tiến bao gồm một số lượng không giới hạn của các cửa hàng phụ và khả năng quản lý cửa hàng của bạn thông qua một ứng dụng điện thoại di động</p> <br>'),
('vi', 'product_state_description.ult.ru.new', '<p>You can use one of these licenses: <a href=\"[standard_license_url]\" target=\"_blank\">[product]</a> or <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate</a>. Both licenses allow you to use [product] without time restrictions.</p><br>'),
('vi', 'product_state_description.ult.ru', '<p>You\'ve activated your [product]. You can use it without time restrictions now. To be able to use an unlimited number of storefronts, get the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate license.</a></p><br>'),
('vi', 'product_state_description.ult.ru.ultimate', '<p>You\'ve activated your [product] Ultimate. You can use it without time restrictions now. With [product] Ultimate, you get the ability to use an unlimited number of storefronts.</p><br>'),
('vi', 'text_store_mode_changed_to_ult', 'Cửa hàng của bạn bây giờ sử dụng giấy phép hoạt động. Với bản [product], bạn có được hầu như tất cả các tính năng chúng tôi cung cấp ngoại trừ một số lượng không giới hạn của storefronts và khả năng quản lý cửa hàng của bạn thông qua một ứng dụng điện thoại di động. Hai tính năng bổ sung chỉ có sẵn với <a href=\"[ultimate_license_url]\" target=\"_blank\"> [product] Phiên bản Ultimate</a>.'),
('vi', 'text_store_mode_changed_to_ult.ultimate', 'Cửa hàng của bạn bây giờ sử dụng giấy phép hoạt động. Với [product] Ultimate, bạn nhận được tất cả các tính năng thương mại điện tử tiên tiến bao gồm một số lượng không giới hạn của cửa hàng phụ và khả năng quản lý cửa hàng của bạn thông qua một ứng dụng điện thoại di động.'),
('vi', 'text_store_mode_changed_to_ult.ru', 'Your store now uses an active license. With the [product] edition, you get almost all the features we offer, except for an unlimited number of storefronts. This feature is available with the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate edition</a> only.'),
('vi', 'text_store_mode_changed_to_ult.ru.ultimate', 'Your store now uses an active license. With the [product] Ultimate edition, you get the ability to use an unlimited number of storefronts.'),
('vi', 'ultimate_license_required', 'Bạn cần [product] Ultimate cho việc này'),
('vi', 'text_ultimate_license_required', 'You\'re using the [product] edition. We also offer another one, a more advanced edition &mdash; [product] Ultimate. With [product] Ultimate, you\'ll be able to add an unlimited number of storefronts and operate your store via a mobile application. To unlock these two features, get the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate license</a>.'),
('vi', 'text_ultimate_license_required.ru', 'You\'re using the [product] edition. We also offer a more advanced edition &mdash; [product] Ultimate. With [product] Ultimate, you\'ll be able to use an unlimited number of storefronts. To unlock this feature, get the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate license</a>.'),
('vi', 'available_upgrades', 'Available upgrades'),
