('vi', 'recaptcha_upgrade_notification_title', 'Switch to Google reCAPTCHA to protect against bots'),
('vi', 'recaptcha_upgrade_notification_text', '[product] now comes with the <b>Google reCAPTCHA</b> add-on to improve anti-bot validation. The add-on has been installed and activated during the upgrade, but the old CAPTCHA will still be used until you configure the add-on. We recommend switching to Google reCAPTCHA as soon as possible. To do that: <ol><li>Go to <b>Add-ons → Manage add-ons</b>.</li><li>Find and click on <b>Google reCAPTCHA</b> in the list of add-ons.</li><li>A pop-up window will open. Enter <b>Site key</b> and <b>Secret token</b>, then save your changes. The instructions on how to get the key and token are available <a href=\'https://developers.google.com/recaptcha/docs/start\'>here</a>.</li></ol> <b>The Google reCAPTCHA add-on supports only the Responsive theme and its <a href=\'http://docs.cs-cart.com/4.5.x/designer_guide/parent_themes.html\'>child themes</a>.</b> Please contact the developer of your theme for more information before you switch to Google reCAPTCHA.'),
('vi', 'tt_views_shippings_components_services_ups_ship_ups_pickup_type', '<p>Select \"Daily Pickup\" to calculate the delivery cost according to Daily Rates.</p><p>Select \"One Time Pickup\", \"Letter Center\", or \"Air Service Center\" to calculate the delivery cost according to Retail Rates.</p>'),
('vi', 'ups_suggested_retail_rates_upgrade_notification_title', '\"Suggested Retail Rates\" Pickup type for the UPS-based shipping methods is no longer supported'),
('vi', 'ups_suggested_retail_rates_upgrade_notification_text', '<p>The latest [product] version doesn\'t support the \"Suggested Retail Rates\" Pickup type for the UPS-based shipping methods.</p><p>If you used Suggested Retail Rates before, do this to actualize the delivery cost for your customers:</p><ul><li>Go to Administration → Shipping & taxes → Shipping methods.</li><li>Select the shipping method that uses UPS as a carrier.</li><li>Switch to the Configure tab and select a proper Pickup type: use \"One Time Pickup\", \"Letter Center\", or \"Air Service Center\" to calculate the delivery cost according to Retail Rates</li></ul>'),
('vi', 'php_extension_missing', 'The [extension] PHP extension is not installed on your server'),
('vi', 'customization', 'Customization'),
('vi', 'captcha_upgrade_notification_title', 'Image verification was fully replaced by Google reCAPTCHA'),
('vi', 'captcha_upgrade_notification_text', '<p>Previously you had to use <b>Settings → Image verification</b> to configure anti-bot protection. Starting with [product] 4.5.1, that section of the settings doesn\'t exist. All relevant settings were moved to the Google reCAPTCHA add-on. The values of those settings remain as they were before the upgrade.</p><p>The Google reCAPTCHA add-on is now the only mechanism of anti-bot protection available in [product] by default. To set up anti-bot validation, follow these steps:</p><ol><li>Go to <b>Add-ons → Manage add-ons</b>.</li><li>Find and click on <b>Google reCAPTCHA</b> in the list of add-ons.</li><li>A pop-up window will open. Enter <b>Site key</b> and <b>Secret token</b>, then save your changes. The instructions on how to get the key and token are available <a href=\'https://developers.google.com/recaptcha/docs/start\' target=\'_blank\'>here</a>.</li><li>Configure other settings of the add-on as you see fit.</li></ol>'),
