('vi', 'upgrade_fl54_atol_boxberry_title', 'New features of Russian version of CS-Cart 4.6.1: compliance with Federal Law 54, add-ons for retailCRM and Boxberry'),
('vi', 'upgrade_fl54_atol_boxberry_text', '<p>The following tools were added to help store owners comply with Federal Law 54 and work with online cash registers:</p><ul><li>The ability to <a href=\"https://www.cs-cart.ru/docs/4.6.x/user_guide/payment_methods/yandex_54fz.html\">send receipt data to Yandex.Checkout</a>.</li><li>The <a href=\"https://www.cs-cart.ru/docs/4.6.x/user_guide/addons/atol_online/\">ATOL Online</a> add-on that integrates CS-Cart with this rent-an-online-cash-register service.</li></ul><p>Other additions:</p><ul><li>An add-on for <a href=\"https://www.cs-cart.ru/docs/4.6.x/user_guide/addons/retailcrm/\">exchanging data with retailCRM</a>;</li><li>An add-on for <a href=\"https://www.cs-cart.ru/docs/4.6.x/user_guide/shipping_and_taxes/shipping_methods/realtime_shipping_methods/boxberry.html\">creating real-time shipping methods that use Boxberry</a>, a Russian shipping service.</li></ul>'),
