('vi', 'buy_in_advance_upgrade_notification.title', 'New behavior of \"Out of stock actions: Buy in advance\"'),
('vi', 'buy_in_advance_upgrade_notification.message', '<p>Customers can now preorder products that have <b>Out of stock actions</b> set to <i>Buy in advance</i> even when the <b>Allow negative amount in inventory</b> setting is disabled. Currently the following products are available on backorder:</p><ul>[products_list]</ul><p>If you don\'t want to allow customers to purchase some of these products while you don\'t have them in stock, please edit these products and set their <b>Out of stock actions</b> to <i>None</i>.</p>'),
('vi', 'invoice_heading', 'Invoice'),
('vi', 'new_invoice_langvar_upgrade_notification_title', 'New language variable for invoice heading'),
('vi', 'new_invoice_langvar_upgrade_notification_message', '<p>A new language variable called <b>invoice_heading</b> has been added. You can use it to alter the title of your invoices as you see fit without altering the word \"Invoice\" in other parts of the store. The values for <b>invoice_heading</b> have been copied from the values of the <b>invoice</b> language variable.</p><p>Please note that whether or not the language variable appears in your invoices depends on <a href=\"http://docs.cs-cart.com/latest/user_guide/look_and_feel/documents/enable_document_editor.html\">whether or not you use the email template and document editors</a>:</p><ul><li>If you use the editors, then you\'ll have to add the new language variable to your invoice manually.</li><li>If you use the old way of editing documents (via TPL files), then the new language variable is already included in the default TPL files.</li></ul>'),
