('vi', 'ttc_paypal_use_in_context_checkout', 'Thanh toán trong bối cảnh này sẽ không được sử dụng khi các cửa hàng đang chạy trong chế độ widget'),
('vi', 'paypal_express_notice', 'Một ID thương gia là cần thiết để sử dụng <a href=\'https://developer.paypal.com/docs/classic/express-checkout/in-context\' target=\'_blank\'> tính năng thanh toán trong bối cảnh</a> trong hội nhập này. Bạn có thể tìm kiếm thương gia của bạn ID bằng cách đăng nhập vào <a href=\'https://www.paypal.com/\' target=\'_blank\'> https://www.paypal.com/</a>. Nhấp vào biểu tượng cấu hình trên bên phải trên cùng của trang và sau đó chọn <b>tiểu sử và các cài đặt</b> trong trình đơn <b>Cấu hình doanh nghiệp</b>. (Nếu bạn không thấy biểu tượng tiểu sử ở đầu trang, bấm vào <b>hồ sơ</b>, xuất hiện trong trình đơn hàng đầu khi chọn <b>tab Tài khoản của tôi</b>.) Nhấp vào <b>thông tin doanh nghiệp của tôi</b> ở bên trái, và các <b>thương gia tài khoản ID</b> sẽ được hiển thị trong danh sách các mục cấu hình trên bên phải.'),
('vi', 'paypal_ipn_note', 'Thông báo thanh toán ngay lập tức (IPN) là một dịch vụ tự động thông báo cho các thương gia của các sự kiện liên quan đến giao dịch PayPal. <br>Khi một khách hàng những nơi một đơn đặt hàng và chọn PayPal như là phương thức thanh toán, các đơn đặt hàng được trạng thái <b>mở</b>. <br>PayPal rồi gửi tin nhắn tức thì thanh toán thông báo bao gồm trạng thái giao dịch. Tình trạng này sẽ thay đổi tình trạng đơn hàng trong cửa hàng của bạn theo bản đồ chuyển đổi trạng thái.'),
('vi', 'paypal_ipn_transaction_status', 'Tình trạng giao dịch');
