('vi', 'addons.paypal.surcharge_policy_notice', 'Surcharge đã được thiết lập cho phương thức thanh toán sử dụng dịch vụ PayPal. Hãy chắc chắn rằng điều này phù hợp với <a href=\"https://www.paypal.com/webapps/mpp/ua/legalhub-full\" target=\"_blank\"> Thỏa thuận người dùng cho các dịch vụ PayPal</a> cho khu vực của bạn.'),
