('vi', 'addons.paypal.status_for_new_orders.open', 'Theo mặc định, tình trạng <i>mở</i> giảm hàng tồn kho, do đó, hai khách sẽ không thể mua cùng một sản phẩm trong khi các khoản thanh toán đang được xử lý bằng PayPal. Nhưng nếu một khách hàng rời khỏi trang web PayPal mà không trả tiền hoặc trở lại đến cửa hàng qua liên kết trên trang web PayPal, bạn sẽ có một đơn hàng bị bỏ rơi <i>mở</i> đơn đặt hàng với các sản phẩm dành riêng.'),
('vi', 'addons.paypal.status_for_new_orders.incomplete', 'Điều này đảm bảo rằng bạn sẽ không hủy bỏ đơn đặt hàng chưa thanh toán với trạng thái <i>mở</i> và dành riêng các sản phẩm. Nhưng cho đến khi các phản ứng từ PayPal (IPN qua thư) đến hoặc khách hàng trả lại để lưu trữ thông qua một liên kết trên trang web PayPal, đơn hàng sẽ được liệt kê như là <i>Incomplete</i>, sản phẩm sẽ không được bảo lưu.'),
