('vi', 'hybrid_auth.specify_email', 'Chỉ định email'),
('vi', 'hybrid_auth.specify_email_title', 'Email không được chỉ định.'),
('vi', 'hybrid_auth.text_specify_email', '<p>Khi đăng nhập thông qua các email mạng xã hội không được chỉ định.</p> <p>Xin vui lòng nhập địa chỉ email của bạn và nhấp vào tiếp tục.</p>'),
('vi', 'hybrid_auth_menu_description', 'Tạo nhà cung cấp mạng xã hội'),
('vi', 'public_key', 'Khóa công khai'),
('vi', 'paypal_seamless', 'Sử dụng thanh toán liền mạch'),
('vi', 'paypal_sandbox', 'Chế độ kiểm tra'),
('vi', 'privileges.manage_providers', 'Quản lý nhà cung cấp mạng xã hội đăng nhập'),
('vi', 'privileges.view_providers', 'Xem nhà cung cấp mạng xã hội đăng nhập'),
('vi', 'hybrid_auth.instruction_facebook', 'Sử dụng ID ứng dụng và Secret key mà bạn đã nhận được sau khi tạo một ứng dụng <a href=\'https://developers.facebook.com/apps\' target=\'_blank\'> Facebook</a> nhà phát triển.'),
('vi', 'hybrid_auth.instruction_facebook_login', 'Use the application ID and Secret key that you\'ve received after creating an application on <a href=\"https://developers.facebook.com/apps\" target=\"_blank\">Facebook Developers</a>. After that copy the value of the <b>Valid OAuth redirect URIs</b> field to the corresponding setting of the <b>Facebook Login</b> product in your Facebook application.'),
('vi', 'hybrid_auth.instruction_google', 'Sử dụng ID và Secret key mà bạn đã nhận được sau khi tạo một dự án trên <a href=\'https://code.google.com/apis/console/?pli=1\' target=\'_blank\'> Google</a>.'),
('vi', 'hybrid_auth.instruction_paypal', 'Sử dụng ID ứng dụng và Secret key mà bạn đã nhận được sau khi tạo một ứng dụng <a href=\'https://developer.paypal.com/developer/applications\' target=\'_blank\'> PayPal Developers</a>.'),
('vi', 'hybrid_auth.instruction_twitter', 'Sử dụng ID (tConsumer key) và Secret key mà bạn đã nhận được sau khi tạo một ứng dụng trên <a href=\'https://apps.twitter.com/\' target=\'_blank\'> Twitter</a>.'),
('vi', 'hybrid_auth.instruction_yahoo', 'Use ID (Identificator) and Secret key that you\'ve received after creating an application on <a href=\'https://developer.yahoo.com/apps/create/\' target=\'_blank\'>Yahoo</a>.'),
('vi', 'hybrid_auth.instruction_live', 'Sử dụng ID ứng dụng và Secret key mà bạn đã nhận được sau khi thêm một ứng dụng trên <a href=\'https://account.live.com/developers/applications/create\' target=\'_blank\'> Live</a>.'),
('vi', 'hybrid_auth.instruction_linkedin', 'Sử dụng ID (Consumer key) và Secret key mà bạn đã nhận được sau khi tạo một ứng dụng trên <a href=\'https://www.linkedin.com/developer/apps\' target=\'_blank\'> LinkedIn nhà phát triển</a>.'),
('vi', 'hybrid_auth.instruction_foursquare', 'Sử dụng ID ứng dụng và Secret key mà bạn đã nhận được sau khi tạo một ứng dụng trên <a href=\'https://foursquare.com/developers/apps\' target=\'_blank\'> Fousquare</a>.'),
('vi', 'email_template.hybrid_auth_create_profile', 'Tạo hồ sơ người dùng thông qua đăng nhập xã hội'),
('vi', 'hybrid_auth.provider_not_found', 'Provider [provider] not found'),
('vi', 'hybrid_auth.facebook_disabled_upgrade_notification_title', 'Social Login: Sign-ins via Facebook have been disabled due to an old PHP version'),
('vi', 'hybrid_auth.facebook_disabled_upgrade_notification_text', '<p>We had to move to a newer version of Facebook API, because the API version that we used previously is no longer supported. However, to work with the new API, [product] requires PHP 5.4. You are seeing this message because your server has an older PHP version.</p><p>The status of the <b>Facebook</b> provider under <b>Website → Social login</b> has been set to <i>Disabled</i>.</p><p>Please update your PHP version to 5.4 or higher before you re-enable Facebook.</p>'),
('vi', 'hybrid_auth.facebook_oauth_redirect_uris', 'Valid OAuth redirect URIs'),
('vi', 'catalog_mode', 'Chế độ danh mục'),
('vi', 'text_catalog_mode_zero_price_action_notice', 'Đặt hàng với nút \"Mua ngay\" có thể hiển thị trên trang chi tiết sản phẩm, xin vui lòng thiết lập mục \"Thao tác khi giá là 0\" là \"Cho phép khách hàng thêm sản phẩm vào giỏ hàng\".'),
