('Languages::store_mode.ultimate', 'Ultimate'),
('Languages::product_state_description.ult.new', '<p>You can use one of these licenses: <a href=\"[standard_license_url]\" target=\"_blank\">[product]</a> or <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate</a>. Both licenses allow you to use [product] without time restrictions.</p><br>'),
('Languages::product_state_description.ult', '<p>You\'ve activated your [product]. You can use it without time restrictions now. To be able to add an unlimited number of extra storefronts and manage your store via a mobile app, get the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate license.</a></p><br>'),
('Languages::product_state_description.ult.ultimate', '<p>You\'ve activated your [product] Ultimate. You can use it without time restrictions now. With [product] Ultimate, you get all the advanced eCommerce features including an unlimited number of extra storefronts and the ability to manage your store via a mobile app.</p><br>'),
('Languages::product_state_description.ult.ru.new', '<p>You can use one of these licenses: <a href=\"[standard_license_url]\" target=\"_blank\">[product]</a> or <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate</a>. Both licenses allow you to use [product] without time restrictions.</p><br>'),
('Languages::product_state_description.ult.ru', '<p>You\'ve activated your [product]. You can use it without time restrictions now. To be able to use an unlimited number of storefronts, get the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate license.</a></p><br>'),
('Languages::product_state_description.ult.ru.ultimate', '<p>You\'ve activated your [product] Ultimate. You can use it without time restrictions now. With [product] Ultimate, you get the ability to use an unlimited number of storefronts.</p><br>'),
('Languages::text_store_mode_changed_to_ult', 'Your store now uses active license. With the [product] edition, you get almost all the features we offer except for an unlimited number of storefronts and the ability to manage your store via a mobile app. These two additional features are available with the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate edition</a> only.'),
('Languages::text_store_mode_changed_to_ult.ultimate', 'Your store now uses active license. With the [product] Ultimate edition, you get all the advanced eCommerce features including an unlimited number of extra storefronts and the ability to manage your store via a mobile app.'),
('Languages::text_store_mode_changed_to_ult.ru', 'Your store now uses an active license. With the [product] edition, you get almost all the features we offer, except for an unlimited number of storefronts. This feature is available with the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate edition</a> only.'),
('Languages::text_store_mode_changed_to_ult.ru.ultimate', 'Your store now uses an active license. With the [product] Ultimate edition, you get the ability to use an unlimited number of storefronts.'),
('Languages::ultimate_license_required', 'You need [product] Ultimate for this'),
('Languages::text_ultimate_license_required', 'You\'re using the [product] edition. We also offer another one, a more advanced edition &mdash; [product] Ultimate. With [product] Ultimate, you\'ll be able to add an unlimited number of storefronts and operate your store via a mobile application. To unlock these two features, get the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate license</a>.'),
('Languages::text_ultimate_license_required.ru', 'You\'re using the [product] edition. We also offer a more advanced edition &mdash; [product] Ultimate. With [product] Ultimate, you\'ll be able to use an unlimited number of storefronts. To unlock this feature, get the <a href=\"[ultimate_license_url]\" target=\"_blank\">[product] Ultimate license</a>.'),
