INSERT INTO `cscart_page_descriptions` (`page_id`, `lang_code`, `page`, `description`, `meta_keywords`, `meta_description`, `page_title`, `link`) VALUES
(1, 'vi', 'Đội ngủ', '<p>Chúng tôi là một tập thể thật tuyệt vời!</p>', '', '', '', ''),
(2, 'vi', 'Thông tin doanh nghiệp', '<p>Số 10 - Bàu Cát 1 - Tân Bình - TPHCM\r\n</p>', '', '', '', ''),
(3, 'vi', 'Privacy policy', '<h1><span style=\"font-size: x-large;\">Privacy Policy</span></h1>\n<p>&nbsp;</p>\n<h3>What information do we collect?</h3>\n<p>We collect information from you when you register on our site, place an order, subscribe to our newsletter or fill out a form.</p>\n<p>When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address or mailing address. You may, however, visit our site anonymously.</p>\n<p>&nbsp;</p>\n<h3>What do we use your information for?</h3>\n<p>Any of the information we collect from you may be used in one of the following ways:</p>\n<ul>\n<li>To personalize your experience<br /> (your information helps us to better respond to your individual needs)</li>\n<li>To improve our website<br /> (we continually strive to improve our website offerings based on the information and feedback we receive from you)</li>\n<li>To improve customer service<br /> (your information helps us to more effectively respond to your customer service requests and support needs)</li>\n<li>To process transactions\n<ul>\n<li>Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.</li>\n</ul>\n</li>\n<li>To administer a contest, promotion, survey or other site feature</li>\n<li>To send periodic emails<br />\n<ul>\n<li>The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.</li>\n</ul>\nNote: If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.</li>\n</ul>\n<p>&nbsp;</p>\n<h3>How do we protect your information?</h3>\n<p>We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.</p>\n<p>We offer the use of a secure server. All supplied sensitive information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems, and are required to keep the information confidential.</p>\n<p>&nbsp;</p>\n<h3>Do we use cookies?</h3>\n<p>Yes (Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information).</p>\n<p>We use cookies to help us remember and process the items in your shopping cart, understand and save your preferences for future visits and keep track of advertisements.</p>\n<p>&nbsp;</p>\n<h3>Do we disclose any information to outside parties?</h3>\n<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</p>\n<p>&nbsp;</p>\n<h3>Third party links</h3>\n<p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.</p>\n<p>&nbsp;</p>\n<h3>Online Privacy Policy Only</h3>\n<p>This online privacy policy applies only to information collected through our website and not to information collected offline.</p>\n<p>&nbsp;</p>\n<h3>Your Consent</h3>\n<p>By using our site, you consent to our privacy policy.</p>\n<p>&nbsp;</p>\n<h3>Changes to our Privacy Policy</h3>\n<p>If we decide to change our privacy policy, we will post those changes on this page, and/or update the Privacy Policy modification date below.</p>\n<p>This policy was last modified on 01.12.2012</p>', '', '', '', ''),
(4, 'vi', 'Free Returns', '<p>To guarantee customer satisfaction, we offer free returns for the products that for some reasons did not met our customer\'s expectations.</p><p>You can create a return request right from your customer account.</p>', '', '', '', ''),
(6, 'vi', 'Low Price Guarantee', '<p>We guarantee the lowest prices on the products presented in our store.</p><p>If you find a lower price for any of our products, offered by a designated online retailer, save the link and contact us.</p><p>After we verify that our competitor\'s price is more attractive, we will lower ours to be at least as low!</p>', '', '', '', ''),
(19, 'vi', 'Why Buy Gift Certificates', '<h1 class=\"ty-main-title\">Why Gift Certificate Is The Best Present Nowadays\n\n</h1>\n\n<div class=\"ty-list-container clearfix\">\n\n  <div class=\"ty-column4\">\n\n      <div class=\"ty-gift-certificate__item\">\n\n          <div class=\"ty-list-image\" style=\"margin-bottom: 15px;\">\n\n              <img src=\"images/companies/1/pages/gift1.jpg\">\n\n          </div>\n\n          <div class=\"ty-list-text big\" style=\"padding-top: 0;\">\n\n                    How often do find yourself wondering what present you should buy for someone?\n\n              <br>\n\n                Choosing presents for friends is easier because you know their habits and preferences. But what about the people whom you know less?\n\n          </div>\n\n      </div>\n\n  </div>\n\n  <div class=\"ty-column4\">\n\n      <div class=\"ty-gift-certificate__item\">\n\n          <div class=\"ty-list-image\" style=\"margin-bottom: 15px;\">\n\n              <img src=\"images/companies/1/pages/gift2.jpg\">\n\n          </div>\n\n          <div class=\"ty-list-text big\" style=\"padding-top: 0;\">\n\n                   There is hardly such a person who wants their present to gather dust in the cupboard and get thrown away during cleaning or given as a gift to someone else.\n\n          </div>\n\n      </div>\n\n  </div>\n\n  <div class=\"ty-column4\">\n\n      <div class=\"ty-gift-certificate__item\">\n\n          <div class=\"ty-list-image\" style=\"margin-bottom: 15px;\">\n\n              <img src=\"images/companies/1/pages/gift3.jpg\">\n\n          </div>\n\n          <div class=\"ty-list-text big\" style=\"padding-top: 0;\">\n\n                   Not only does a present show care, but it also reminds about the person who gave it.\n\n          </div>\n\n      </div>\n\n  </div>\n\n  <div class=\"ty-column4\">\n\n      <div class=\"ty-gift-certificate__item\">\n\n          <div class=\"ty-list-image\" style=\"margin-bottom: 15px;\">\n\n              <img src=\"images/companies/1/pages/gift4.jpg\">\n\n          </div>\n\n          <div class=\"ty-list-text big\" style=\"padding-top: 0;\">\n\n                   Give your friends a gift certificate of our store, and you can be sure that they will choose a present to their liking and will remember that you care!\n\n          </div>\n\n      </div>\n\n  </div>\n\n</div>\n\n<div style=\"margin-bottom: 40px;\" class=\"ty-buttons-container ty-main-buttons ty-center\">\n\n  <a href=\"index.php?dispatch=gift_certificates.add\" class=\"ty-btn__primary ty-btn__big ty-btn\">Buy a gift certificate</a>\n\n</div>\n\n', '', '', '', ''),
(20, 'vi', 'Liên hệ', '<h1 class=\"ty-main-title\">Liên hệ</h1><div class=\"ty-column4\">\r\n	<h4>Địa chỉ:</h4>\r\n	<div>\r\n		Số 10 Bàu Cát 1,\r\n		<br>\r\n		Tân Bình, TPHCM\r\n	</div>\r\n	<h4>\r\n	Email:\r\n	</h4>\r\n	<div><a href=\"mailto:sales@example.com\">rausachonline@gmail.com</a>\r\n	</div>\r\n	<h4>\r\n	Số điện thoại:</h4>\r\n	<div>\r\n		+84 6427368234\r\n	</div>\r\n	<div>\r\n		(gọi miễn phí)\r\n	</div>\r\n</div><div class=\"ty-column4 ty-float-right ty-notice\">\r\n	<div>\r\n		<h5>Thời gian làm việc:</h5>\r\n		<p>7h sáng — 6h tối\r\n		</p>\r\n		<p>\r\n			Thứ 2 đến Thứ 6\r\n		</p>\r\n	</div>\r\n</div><div class=\"ty-column1\">\r\n	<iframe src=\"https://www.google.com/maps/embed?&#9;&#9;pb=!1m18!1m12!1m3!1d3919.2144348968504!2d106.63915531435057!3d10.794881992308968!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3175294d793a36c1%3A0x51d6f87cd5f89eeb!2zMTAgQsOgdSBDw6F0IDEsIHBoxrDhu51uZyAxNCwgVMOibiBCw6xuaCwgSOG7kyBDaMOtIE1pbmgsIFZp4buHdCBOYW0!5e0!3m2!1svi!2sru!4v1528862220799\" width=\"100%\" height=\"400\" frameborder=\"0\" style=\"border:0\" allowfullscreen=\"\"></iframe>\r\n</div><div class=\"ty-column2\">\r\n	<div>\r\n		<h3><br></h3>\r\n	</div>\r\n</div>', '', '', '', ''),
