(23, 'vi', 'Điểm thưởng', '<h1 class=\"ty-main-title\">\r\n	Tiết kiệm chi phí—Rinh ngay điểm thưởng</h1><div class=\"ty-column2\">\r\n		<img class=\"ty-image\" src=\"images/companies/1/pages/reward-points-1.png\">\r\n	</div><div class=\"ty-column2\">\r\n		<div class=\"ty-column1 ty-notice\">\r\n		<p>\r\n			Khi bạn thanh toán sản phẩm, bạn sẽ nhận ngay số điểm thưởng nhất định.</p>\r\n		<p>\r\n			Bạn có thể sử dụng chúng bất kỳ lúc nào—chúng tôi khuyên bạn nên sử dụng điểm thưởng trước khi hết hạn sử dụng.</p>\r\n		</div>\r\n		<div class=\"ty-column1\">\r\n			<h3>Xem bạn có bao nhiêu điểm</h3>\r\n			<div>\r\n				<img class=\"ty-image\" src=\"images/companies/1/pages/reward-points-3.png\">\r\n			</div>\r\n		</div>\r\n	</div><div class=\"ty-column1 ty-notice\">\r\n		<h3>Sử dụng điểm thưởng của bạn</h3>\r\n		<div>\r\n			<img src=\"images/companies/1/pages/reward-points-2.png\">\r\n		</div>\r\n		<div class=\"ty-column1\">\r\n			<p>\r\n<br>				Khi bạn đang ở trang thanh toán, nhập điểm thưởng mà bạn muốn dùng bên cột bên phải. Sổ điểm bạn có sẽ được hệ thống tự động trừ vào điểm tích lũy.\r\n			</p>\r\n		</div>\r\n	</div>', '', '', '', ''),
