(1, 'Credit card', 'Visa, Mastercard, etc...', '', '', 'vi'),
(2, 'Phone ordering', 'Call to 5555555', '<h2>When I should use phone ordering?</h2><p>Order by phone is useful when regular payment methods like credit card are unavailable or considered insecure.</p><p>Our operators are happy to take your order per phone every business day from 9 a.m. to 5 p.m. UTC.</p>', '', 'vi'),
(4, 'Paypal Express Checkout', 'Fax: (555) 555-5555', '<p>Type instructions to pay by visiting your retail store in here.\r\n</p>', '', 'vi'),
(3, 'Check', 'Check payment', '<h2>When I should use check payment</h2><p>Paying with a check is a useful option in case other payment options are unavailable or considered insecure. Note that a check payment is complete only when the check is cashed and clears the bank.</p><p>To pay with a check, enter your signature, account number, and the bank routing number, which is simply a number identifying your bank.</p>', '', 'vi'),
(5, 'Money Order', 'US Banks Only', 'Type instructions to pay by visiting your retail store in here.', '', 'vi'),
(6, 'C.O.D', 'Cashiers Check or Cash Only', 'Type instructions to pay by visiting your retail store in here.', '', 'vi'),
(7, 'Purchase Order', '', 'Type instructions to pay by visiting your retail store in here.', '', 'vi'),
(8, 'Personal Check', 'US Funds Only', 'Type instructions to pay by visiting your retail store in here.', '', 'vi'),
(9, 'Business Check', 'Drawn on US Bank and in US Dollars', 'Type instructions to pay by visiting your retail store in here.', '', 'vi'),
