INSERT INTO `cscart_shipping_descriptions` (`shipping_id`, `lang_code`, `shipping`, `delivery_time`, `description`) VALUES
(1, 'vi', 'Giao hàng nhanh', '1-2 giờ', '<p>Thời gian giao hàng được tính toán bởi doanh nghiêp.</p><p>Sản phẩm sẽ được gửi ngay sau khi thanh toán được xác nhận. Dịch vụ giao hàng sẽ chịu toàn bộ trách nhiệm trong suốt quá trình giao hàng.</p><p>Vui lòng kiểm tra ngay sau khi nhận hàng. Nếu có hư hỏng hãy thông báo cho doanh nghiệp thông qua dịch vụ thư điện tử.</p><p>Mọi thắc mắc liên hệ qua đường dây nóng 18001080.</p>'),
(3, 'vi', 'FedEx 2nd day', '2 days', '<p>Delivery time is calculated in business days.</p><p>Products in stock will be sent after the payment is verified. Mail service is responsible for the goods during transportation.</p><p>Please, open the package delivered under your order the moment you receive it. If any damage is revealed, make claims against mail service.</p><p>Any questions? Contact our Customer Service at 123-12-23</p>'),
(4, 'vi', 'UPS 3day Select', '3 days', '<p>Delivery time is calculated in business days.</p><p>Products in stock will be sent after the payment is verified. Mail service is responsible for the goods during transportation.</p><p>Please, open the package delivered under your order the moment you receive it. If any damage is revealed, make claims against mail service.</p><p>Any questions? Contact our Customer Service at 123-12-23</p>'),
(5, 'vi', 'USPS Media Mail', '1-2 days', '<p>Delivery time is calculated in business days.</p><p>Products in stock will be sent after the payment is verified. Mail service is responsible for the goods during transportation.</p><p>Please, open the package delivered under your order the moment you receive it. If any damage is revealed, make claims against mail service.</p><p>Any questions? Contact our Customer Service at 123-12-23</p>');
