   <tr style=\" vertical-align: top; font-family: Helvetica, Arial, sans-serif;\">\n                        <td align=\"left\" style=\"font-family: Helvetica, Arial, sans-serif;\">{% if o.raw.discount %} <div style=\"padding-bottom: 20px; font-family: Helvetica, Arial, sans-serif;\"> {{ __(\"including_discount\") }} </div> {% endif %}\n                        </td>\n                        <td align=\"right\" style=\"font-family: Helvetica, Arial, sans-serif;\">{% if o.raw.discount %} {{o.discount}} {% endif %}\n                        </td>\n                    </tr>\n                    <tr style=\" vertical-align: top; font-family: Helvetica, Arial, sans-serif;\">\n                        <td align=\"left\" style=\"font-family: Helvetica, Arial, sans-serif;\">{% if o.raw.subtotal_discount %} <div style=\"padding-bottom: 20px; font-family: Helvetica, Arial, sans-serif;\"> {{ __(\"order_discount\") }} </div> {% endif %}\n                        </td>\n                        <td align=\"right\" style=\"font-family: Helvetica, Arial, sans-serif;\">{% if o.raw.subtotal_discount %} {{o.subtotal_discount}} {% endif %}\n                        </td>\n                    </tr>\n                    <tr style=\" vertical-align: top; font-size: 22px; font-weight: 600; font-family: Helvetica, Arial, sans-serif;\">\n                        <td align=\"left\" style=\"padding-top: 20px; border-top: 1px solid #e8e8e8; font-size: 22px; font-family: Helvetica, Arial, sans-serif;\">{{ __(\"total\") }}\n                        </td>\n                        <td align=\"right\" style=\"padding-top: 20px; border-top: 1px solid #e8e8e8; font-size: 22px; font-family: Helvetica, Arial, sans-serif;\">{{o.total}}\n                        </td>\n                    </tr>\n                </tbody>\n                </table>\n            </td>\n        </tr>\n        </tbody>\n        </table>\n    </td>\n</tr>\n</tbody>\n</table>', 'order', 'summary', '', 1528699874, 1528699874),
(3, NULL, '<table class=\"main-table\" style=\"height: 100%; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" rel=\"height: 100%; border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\n<tbody>\n<tr>\n    <td style=\"width: 100%; height: 100%; padding: 24px 0; font-family: Helvetica, Arial, sans-serif;\" align=\"center\">\n        <div style=\"background-color: #ffffff; margin: 0px auto; padding: 0px 44px 0px 46px; width: 510px; text-align: left; font-family: Helvetica, Arial, sans-serif;\">\n            <table style=\"border-collapse: separate; padding-top: 32px; font-family: Helvetica, Arial, sans-serif;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\n            <tbody>\n            <tr valign=\"top\">\n                <td style=\"border-bottom: 1px dashed #000000; padding-bottom: 20px; font-family: Helvetica, Arial, sans-serif;\" align=\"center\" width=\"100%\">\n                    <h3 style=\"font-size: 17px; font-weight: bold; font-family: Helvetica, Arial, sans-serif; padding: 0px 0px 3px 1px; margin: 0px;\">{{ __(\"ship_to\") }}:</h3>\n                    <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n                        {{ u.s_firstname }} {{ u.s_lastname }}\n                    </p>\n                    <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n                        {{ u.s_address  }} {{ u.s_address_2 }}\n                    </p>\n                    <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n                        {{ u.s_city }} {{ u.s_state_descr }} {{ u.s_zipcode }}\n                    </p>\n                    <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n                        {{ u.s_country_descr }}\n                    </p>\n                    {% for field in u.s_fields %}\n                    <p style=\"font-family: Helvetica, Arial, sans-serif;\">{{ field.name }}: {{ field.value }}\n                    </p>\n                    {% endfor %}\n                </td>\n            </tr>\n            <tr class=\"scissors\" valign=\"top\">\n                <td style=\"padding-left: 20px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\">\n                    <img style=\"vertical-align: top;\" src=\"{{ runtime.images_dir }}/scissors.gif\" border=\"0\">\n                </td>\n            </tr>\n            </tbody>\n            </table>\n            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\n            <tbody>\n            <tr>\n                <td style=\"width: 50%; padding: 14px 0px 0px 2px;\">\n                    <h2 style=\"font-size: 12px; font-weight: bold; font-family: Helvetica, Arial, sans-serif; margin: 0px 0px 3px 0px;\">{{ c.name }}</h2>\n                    <p style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ snippet(\"company_address\") }}\n                    </p>\n                    <p style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ snippet(\"company_info\") }}<br>\n                    </p>\n                </td>\n                <td style=\"padding-top: 14px; font-family: Helvetica, Arial, sans-serif;\" valign=\"top\">{{ snippet(\"order_date\") }}\n                </td>\n            </tr>\n            </tbody>\n            </table>\n            <table style=\"padding: 20px 0px 24px 0px; font-family: Helvetica, Arial, sans-serif;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\n            <tbody>\n            <tr valign=\"top\">\n                <td style=\"font-family: Helvetica, Arial, sans-serif;\" width=\"54%\">\n                    {{snippet(\"bill_to\")}}\n                </td>\n                <td style=\"font-family: Helvetica, Arial, sans-serif;\" width=\"54%\">\n                    {{snippet(\"ship_to\")}}\n                </td>\n            </tr>\n            </tbody>\n            </table>\n            <div style=\"font-family: Helvetica, Arial, sans-serif;\">\n                {{ snippet(\"order_info\") }}\n            </div>\n            <div style=\"font-family: Helvetica, Arial, sans-serif;\">\n                {{ snippet(\"products_table\") }}\n                <br>{{ snippet(\"notes\") }}\n            </div>\n        </div>\n    </td>\n</tr>\n</tbody>\n</table>', 'packing_slip', 'default', '', 1528699874, 1528699874),
(4, NULL, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\n<tbody>\n<tr>\n    <td style=\"width: 100%; height: 100%;vertical-align: top;\" align=\"center\">\n        <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"600px\">\n        <tbody style=\"font-family: arial;\">\n        <tr>\n            <td style=\"padding: 17px 25px 40px; background: #F57171;\" align=\"center\" valign=\"top\" width=\"600px\">\n                <h1 style=\"color: #fff; text-transform: uppercase; font-size: 40px; font-weight: bold;margin: 10px 0 0;\">\n                {{ __(\"gift_certificate\") }}\n                </h1>\n                <h2 style=\"font-size: 50px; font-weight: 300; color: #fff; margin: 0px; line-height: 1.2em;\">\n                {{ gift_certificate.amount }}\n                </h2>\n                <p style=\"color: #fff; margin: 0 0 12px; font-size: 12px\">\n                    {{ __(\"gift_cert_code\") }}\n                </p>\n                <span style=\"background: #fff; padding: 5px 20px; font-size: 19px; font-weight: lighter; border-radius: 2px;\">\n                {{ gift_certificate.gift_cert_code }}</span>\n            </td>\n        </tr>\n        <tr>\n            <td style=\"padding: 30px 0px 80px;\" valign=\"middle\" width=\"600px\">\n                <div style=\"padding: 10px;\">{{ snippet(\"info\") }}\n                </div>\n                <div>{{ snippet(\"products_table\") }}\n                </div>\n                <div style=\"padding: 30px 20px 0px 20px; text-align: right;\">\n                    {{__(\"shop_now\")}} : <a href=\"{{c.storefront_url}}\" target=\"_blank\">{{c.storefront_url}}</a>\n                </div>\n            </td>\n        </tr>\n        </tbody>\n        </table>\n    </td>\n</tr>\n</tbody>\n</table>', 'gift_certificate', 'default', 'gift_certificates', 1528699879, 1528699879),
(5, NULL, '<table cellspacing=\"0\" width=\"100%\">\n<tbody>\n<tr>\n	<td align=\"center\" width=\"100%\">\n		<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n		<tbody>\n		<tr>\n			<td style=\"background-color: #ffffff; margin: 0px auto; padding: 0px 40px 40px 40px; width: 510px;\" align=\"left\">\n				<h1 style=\"text-align: left; font-size: 26px; font-weight: 600; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; border-bottom: 1px solid #eeeeee; padding: 10px 0px 8px 0px; margin-bottom: 0px;\">\n				{{ __(\"packing_slip\") }}\n				</h1>\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\n				<tbody>\n				<tr valign=\"top\">\n					<td style=\"width: 50%; padding: 14px 0px 0px 2px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n						<h2 style=\"font-size: 17px; font-weight: 400; font-family: Helvetica, Arial, sans-serif; margin: 0px 0px 3px 0px;\"><strong>{{c.name}}</strong></h2>\n						{{ snippet(\"company_address\") }}<br>{{ snippet(\"company_info\") }}\n					</td>\n					<td style=\"padding-top: 14px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n						<h2 style=\"font-size: 17px; font-weight: 400; font-family: Helvetica, Arial, sans-serif; margin: 0px;\"><strong>{{ __(\"rma_return\") }} # {{ r.return_id }}</strong></h2>\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n						<tbody>\n						<tr valign=\"top\">\n							<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"action\") }}:\n							</td>\n							<td width=\"100%\" style=\"font-family: Helvetica, Arial, sans-serif;\">{{ r.action_name}}\n							</td>\n						</tr>\n						<tr valign=\"top\">\n							<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"status\") }}:\n							</td>\n							<td width=\"100%\" style=\"font-family: Helvetica, Arial, sans-serif;\">{{ r.status_name }}\n							</td>\n						</tr>\n						<tr valign=\"top\">\n							<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"date\") }}:\n							</td>\n							<td style=\"font-family: Helvetica, Arial, sans-serif;\">{{ r.timestamp }}\n							</td>\n						</tr>\n						</tbody>\n						</table>\n					</td>\n				</tr>\n				</tbody>\n				</table>\n				<table style=\"padding: 20px 0px 24px 0px;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\n				<tbody>\n				<tr valign=\"top\">\n					<td width=\"54%\" style=\"font-family: Helvetica, Arial, sans-serif;\">\n						{{snippet(\"bill_to\")}}\n					</td>\n					<td width=\"54%\" style=\"font-family: Helvetica, Arial, sans-serif;\">\n						{{snippet(\"ship_to\")}}\n					</td>\n				</tr>\n				</tbody>\n				</table>\n				<div style=\"font-family: Helvetica, Arial, sans-serif;\">\n					{{ snippet(\"products_table\") }}\n				</div>\n				<div>\n					{% if r.comment %}\n					<p style=\"margin-top: 15px; font-weight: 400; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\"><strong>{{ __(\"comments\") }}:</strong>\n					</p>\n					<p style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n						{{ r.comment|nl2br }}\n					</p>\n					{% endif %}\n				</div>\n			</td>\n		</tr>\n		</tbody>\n		</table>\n	</td>\n</tr>\n</tbody>\n</table>', 'rma_packing_slip', 'default', 'rma', 1528699882, 1528699882);
INSERT INTO `cscart_template_emails` (`template_id`, `code`, `area`, `status`, `subject`, `template`, `default_subject`, `default_template`, `params_schema`, `params`, `addon`, `updated`, `created`) VALUES
(1, 'activate_profile', 'A', 'A', NULL, NULL, '{{ company_name }}: {{__(\"new_user_profile\")}}', '{{ snippet(\"header\", {\"title\": __(\"new_user_profile\")} ) }}\n\n    {{ __(\"hello\") }},\n    <br />\n    <br /> {{ __(\"text_new_user_activation\", {\"[user_login]\": user_data.email, \"[url]\": url, \"[url_text]\": url|puny_decode}) }}\n\n{{ snippet(\"footer\") }}', NULL, NULL, '', 1528699873, 1528699873),
(2, 'back_in_stock_notification', 'C', 'A', NULL, NULL, '{{ company_name }}: {{ product.name|striptags }} {{ __(\"is_back_in_stock\") }}', '{{ snippet(\"header\", {\"title\": product.name  } ) }}\n    {{ __(\"hello\") }},\n    <br />\n    <br />\n    {{ __(\"back_in_stock_notification_header\") }}\n    <br />\n    <br />\n    <b><a href=\"{{ url }}\">{{ product.name }}</a></b>\n    <br />\n    <br /> {{ __(\"back_in_stock_notification_footer\") }}\n    <br />\n  {{ snippet(\"footer\") }}', NULL, NULL, '', 1528699873, 1528699873),
(3, 'create_profile', 'A', 'A', NULL, NULL, '{{ company_name }}: {{ __(\"new_profile_notification\") }}', '{{ snippet(\"header\", {\"title\": __(\"new_profile_notification\")} ) }}\n    {% if user_data.firstname %} {{ __(\"dear\") }} {{ user_data.firstname }}, {% else %} {{ __(\"hello\") }}, {% endif %}\n    <br>\n    <br>\n    {{ __(\"create_profile_notification_header\") }}\n    <br>\n    <br>\n    <table border=\"0\" class=\"info\">\n      <tr>\n        <td align=\"right\"><b>{{ __(\"login_url\") }}:</b></td>\n        <td><a href=\"{{ login_url }}\">{{ login_url|puny_decode }}</a></td>\n      </tr>\n      <tr>\n        <td align=\"right\"><b>{{ __(\"email\") }}:</b></td>\n        <td><a>{{ user_data.email }}</a></td>\n      </tr>\n      <tr>\n        <td align=\"right\"><b>{{ __(\"password\") }}:</b></td>\n        <td>\n{% if password %}\n    {{ password }}\n{% else %}\n    *********** (<a href=\"{{ forgot_pass_url }}\">{{ __(\"forgot_password_question\") }}</a>)\n{% endif %}</td>\n      </tr>\n    </table>\n  {{ snippet(\"footer\") }}', NULL, NULL, '', 1528699873, 1528699873),
(4, 'create_profile', 'C', 'A', NULL, NULL, '{{ company_name }}: {{ __(\"new_profile_notification\") }}', '{{ snippet(\"header\", {\"title\": __(\"new_profile_notification\")} ) }}\n    {% if user_data.firstname %} {{ __(\"dear\") }} {{ user_data.firstname }}, {% else %} {{ __(\"hello\") }}, {% endif %}\n    <br>\n    {{ __(\"update_profile_notification_header\") }}\n    <br>\n    <br>\n    <h4 class=\"with-subline\">{{ __(\"user_account_information\") }}</h4>\n    <table border=\"0\" width=\"100%\" class=\"info\">\n      <tr>\n        <td><b>{{ __(\"login_url\") }}:</b></td>\n        <td><a href=\"{{ login_url }}\">{{ login_url|puny_decode }}</a></td>\n      </tr>\n      <tr>\n        <td><b>{{ __(\"email\") }}:</b></td>\n        <td><a>{{ user_data.email }}</a></td>\n      </tr>\n      <tr>\n        <td><b>{{ __(\"password\") }}:</b></td>\n        <td> *********** (<a href=\"{{ forgot_pass_url }}\">{{ __(\"forgot_password_question\") }}</a>)</td>\n      </tr>\n    </table>\n\n\n  {{ snippet(\"footer\") }}', NULL, NULL, '', 1528699873, 1528699873),
(5, 'edp_access', 'C', 'A', NULL, NULL, '{{ company_name }}: {{ __(\"order\") }} #{{ order_info.order_id }} {{ __(\"edp_access_subj\") }}', '{{ snippet(\"header\") }}\n    {{ __(\"dear\") }} {{ order_info.firstname }},\n    <br />\n    <br /> {{ __(\"edp_access_granted\") }}\n    <br />\n    <br /> <a href=\"{{ order_files_list_url }}\"><b>{{ __(\"view_avail_files_for_order\", {\"[order_id]\": order_info.order_id}) }}</b></a>\n    <br />\n    <br /> {% for product in edp_data %}\n    {% for file in product.files %}\n    <a href=\"{{ file.url }}\">{{ file.file_name }} ({{ file.file_size|filesize }}&nbsp;{{ __(\"bytes\") }})</a>\n    <br />\n    <br /> {% endfor %} {% endfor %}\n  {{ snippet(\"footer\") }}', NULL, NULL, '', 1528699873, 1528699873),
(6, 'give_coupon', 'C', 'A', NULL, NULL, '{{ company_name }}: {{ __(\"give_coupon_subj\") }}', '{{ snippet(\"header\", {\"title\": __(\"give_coupon_subj\") } ) }}\n    {{ __(\"hello\") }} {{ order_info.firstname }}\n    <br /> {{ __(\"text_applied_promotions\") }}\n    <br />\n    <br /> {{ promotion_data.name }}\n    <br />\n    <br /> {{ promotion_data.detailed_description }}\n    <br />\n    <b>{{ bonus_data.coupon_code }}</b>\n  {{ snippet(\"footer\") }}', NULL, NULL, '', 1528699873, 1528699873),
(7, 'low_stock', 'A', 'A', NULL, NULL, '{{ company_name }}: {{ __(\"low_stock_subj\", {\"[product]\": \"#{product} ##{product_id}\"}) }}', '{{ snippet(\"header\", {\"title\":__(\"low_stock_subj\", {\"[product]\": \"#{product} ##{product_id}\"}) } ) }}\n\n    <table class=\"info\">\n      <tr>\n        <td>{{ __(\"product\") }}:</td>\n        <td>{{ product }}</td>\n      </tr>\n      <tr>\n        <td>{{ __(\"id\") }}:</td>\n        <td>{{ product_id }}</td>\n      </tr>\n      <tr>\n        <td>{{ __(\"sku\") }}:</td>\n        <td>{{ product_code }}</td>\n      </tr>\n      <tr>\n        <td>{{ __(\"qty\") }}:</td>\n        <td><b>{{ new_qty }}</b></td>\n      </tr>\n      {% if product_options %}\n      <tr>\n        <td colspan=\"2\">{{ __(\"product_options\") }}:\n          <br>\n          <hr>\n        </td>\n      </tr>\n      {% for option in product_options %}\n      <tr>\n        <td>{{ option.option_name }}:</td>\n        <td>{{ option.variant_name }}</td>\n      </tr>\n      {% endfor %} {% endif %}\n    </table>\n\n{{ snippet(\"footer\") }}', NULL, NULL, '', 1528699873, 1528699873),
