(8, 'ship_to', 'order_summary', NULL, '<h2 style=\"margin: 0px; font-size: 22px; font-family: Helvetica, Arial, sans-serif; color: #444444; text-transform: uppercase; margin-bottom: 15px; line-height: 1.5em; \">{{__(\"ship_to\")}}</h2>\n    <p style=\"margin: 0px; font-size:14px; font-family: Helvetica, Arial, sans-serif; padding-bottom: 5px;\">\n        <strong>{{u.s_firstname}} {{u.s_lastname}}</strong>\n    </p>\n    <p style=\"margin: 0px; font-size:14px; font-family: Helvetica, Arial, sans-serif; padding-bottom: 5px;\">\n        {{u.s_address}} <br>{{u.s_address_2}}\n    </p>\n    <p style=\"margin: 0px; font-size:14px; font-family: Helvetica, Arial, sans-serif; padding-bottom: 5px;\">\n        {{u.s_city}}, {{u.s_state_descr}} {{u.s_zipcode}}\n    </p>\n    <p style=\"margin: 0px; font-size:14px; font-family: Helvetica, Arial, sans-serif; padding-bottom: 5px;\">\n        {{u.s_country_descr}}\n    </p>\n    <p style=\"margin: 0px; font-size:14px; font-family: Helvetica, Arial, sans-serif; padding-bottom: 5px;\">\n        <bdi>{{u.s_phone}}</bdi>\n    </p>\n', 'A', NULL, NULL, '', 1528699874, 1528699874),
(9, 'bill_to', 'packing_slip_default', NULL, '<h3 style=\" padding: 0px 0px 10px 1px; font-weight: 600; font-size: 15px; font-family: Helvetica, Arial, sans-serif; border-bottom: 1px solid #ededed;\">{{__(\"bill_to\")}}:</h3>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        {{u.b_firstname}} {{u.b_lastname}}\n    </p>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        {{u.b_address}} <br>{{u.b_address_2}}\n    </p>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        {{u.b_city}}, {{u.b_state_descr}} {{u.b_zipcode}}\n    </p>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        {{u.b_country_descr}}\n    </p>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        <bdi>{{u.b_phone}}</bdi>\n    </p>\n', 'A', NULL, NULL, '', 1528699874, 1528699874),
(10, 'company_address', 'packing_slip_default', NULL, '{% set parts = [c.city] %}\n{% if c.state_descr %}\n    {% set parts = parts|merge([c.state_descr]) %}\n{% endif %}\n\n{{ c.address }} <br />\n{{ parts|join(\', \') }} {{ c.zipcode }}  <br />\n{{ c.country_descr }}', 'A', NULL, NULL, '', 1528699874, 1528699874),
(11, 'company_info', 'packing_slip_default', NULL, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n	<tbody>\n		{% if c.phone %}\n		<tr valign=\"top\">\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"phone1_label\") }}:</td>\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\"><bdi>{{ c.phone }}</bdi></td>\n		</tr>\n		{% endif %}\n		{% if c.phone_2 %}\n		<tr valign=\"top\">\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"phone2_label\") }}:</td>\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\"><bdi>{{ c.phone_2 }}</bdi></td>\n		</tr>\n		{% endif %}\n		{% if c.fax %}\n		<tr valign=\"top\">\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"fax\") }}:</td>\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\"><bdi>{{ c.fax }}</bdi></td>\n		</tr>\n		{% endif %}\n		{% if c.website %}\n		<tr valign=\"top\">\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"web_site\") }}:</td>\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\">{{ c.website }}</td>\n		</tr>\n		{% endif %}\n		{% if c.orders_department %}\n		<tr valign=\"top\">\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"email\") }}:</td>\n			<td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\"><a href=\"mailto:{{ c.orders_department }}\">{{ c.orders_department_display }}</a></td>\n		</tr>\n		{% endif %}\n	</tbody>\n</table>', 'A', NULL, NULL, '', 1528699874, 1528699874),
(12, 'order_date', 'packing_slip_default', NULL, '<h2 style=\"font-size: 17px; font-weight: bold; font-family: Helvetica, Arial, sans-serif; margin: 0px;\">{{ __(\"packing_slip_for_order\") }} #{{ o.order_id }}</h2>\n{% if o.shipment %}\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n    <tbody>\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"order_date\") }}:\n            </td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ o.timestamp }}\n            </td>\n        </tr>\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"shipment_date\") }}:\n            </td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ o.shipment.shipment_timestamp }}\n            </td>\n        </tr>\n    </tbody>\n</table>\n{% else %}\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n    <tbody>\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"date\") }}:\n            </td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ o.timestamp }}\n            </td>\n        </tr>\n    </tbody>\n</table>\n{% endif %}', 'A', NULL, NULL, '', 1528699874, 1528699874),
(13, 'order_info', 'packing_slip_default', NULL, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n    <tbody>\n    <tr valign=\"top\">\n        <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"status\") }}:\n        </td>\n        <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\">{{ o.status.description }}\n        </td>\n    </tr>\n    <tr valign=\"top\">\n        <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"payment_method\") }}:\n        </td>\n        <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" valign=\"bottom\">{{ p.payment|default(\"-\") }}\n        </td>\n    </tr>\n    {% if o.shipment %}\n        {% if o.shipment.shipping %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"shipping_method\") }}:\n            </td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" valign=\"bottom\">{{ o.shipment.shipping }}\n            </td>\n        </tr>\n        {% endif %}\n        {% if o.shipment.tracking_number %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"tracking_number\") }}:\n            </td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" valign=\"bottom\">{{ o.shipment.tracking_number }}\n            </td>\n        </tr>\n        {% endif %}\n    {% else %}\n        {% if o.shippings_method %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"shipping_method\") }}:\n            </td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" valign=\"bottom\">{{ o.shippings_method }}\n            </td>\n        </tr>\n        {% endif %}\n        {% if o.tracking_number %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px; white-space: nowrap;\">{{ __(\"tracking_number\") }}:\n            </td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" valign=\"bottom\">{{ o.tracking_number }}\n            </td>\n        </tr>\n        {% endif %}\n    {% endif %}\n\n    </tbody>\n</table>', 'A', NULL, NULL, '', 1528699874, 1528699874),
(14, 'notes', 'packing_slip_default', NULL, '{% if o.shipment.comments %}\n<div style=\"float: left; padding-top: 20px; font-family: Helvetica, Arial, sans-serif;\"><strong>{{ __(\"comments\") }}:</strong></div>\n<div style=\"padding-left: 7px; padding-bottom: 15px; overflow-x: auto; clear: both; width: 505px; height: 100%; padding-bottom: 20px; overflow-y: hidden; font-family: Helvetica, Arial, sans-serif;\">{{ o.shipment.comments|wordwrap(90,\"\\n\")|nl2br }}</div>\n{% elseif o.notes %}\n<div style=\"float: left; padding-top: 20px;\"><strong>{{ __(\"notes\") }}:</strong></div>\n<div style=\"padding-left: 7px; padding-bottom: 15px; overflow-x: auto; clear: both; width: 505px; height: 100%; padding-bottom: 20px; overflow-y: hidden; font-family: Helvetica, Arial, sans-serif;\">{{ o.notes|wordwrap(90, \"\\n\")|nl2br }}</div>\n{% endif %}', 'A', NULL, NULL, '', 1528699874, 1528699874),
(15, 'products_table', 'packing_slip_default', NULL, '<table width=\"100%\" cellpadding=\"0\" cellspacing=\"1\" style=\"border-collapse: separate; border-spacing: 1px; background-color: #dddddd; margin-top: 20px; font-family: Helvetica, Arial, sans-serif;\">\n\n<thead>\n    <tr>\n\n        {% for  header in products_table.headers %}\n            <th style=\"background-color: #eeeeee; padding: 6px 10px; white-space: nowrap; font-size: 12px; text-align:center; font-family: Helvetica, Arial, sans-serif;\">{{ header }}</th>\n        {% endfor %}\n    </tr>\n</thead>\n<tbody>\n    {% for  row in products_table.rows %}\n        <tr>\n            {% for  column in row %}\n                <td style=\"padding: 5px 10px; background-color: #ffffff; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ column }}</td>\n            {% endfor %}\n        </tr>\n    {% endfor %}\n</tbody>\n</table>', 'A', '{\"used_table\":\"1\",\"variable_schema\":\"packing_slip_products_table\"}', '\"fn_snippet_init_order_product_table_variable\"', '', 1528699874, 1528699874),
(16, 'ship_to', 'packing_slip_default', NULL, '<h3 style=\"padding: 0px 0px 10px 1px; font-weight: 600; font-size: 15px; font-family: Helvetica, Arial, sans-serif; border-bottom: 1px solid #ededed;\">{{__(\"ship_to\")}}:</h3>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        {{u.s_firstname}} {{u.s_lastname}}\n    </p>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        {{u.s_address}} <br>{{u.s_address_2}}\n    </p>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        {{u.s_city}}, {{u.s_state_descr}} {{u.s_zipcode}}\n    </p>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        {{u.s_country_descr}}\n    </p>\n    <p style=\"font-family: Helvetica, Arial, sans-serif;\">\n        <bdi>{{u.s_phone}}</bdi>\n    </p>\n', 'A', NULL, NULL, '', 1528699874, 1528699874),
(17, 'info', 'gift_certificate_default', NULL, '{% if gift_certificate.send_via == \'P\' %}\n<p>\n    {{ __(\"gift_cert_from\") }}: {{ gift_certificate.sender }}\n</p>\n<p>\n    {{ __(\"gift_cert_to\") }}: {{ gift_certificate.recipient }}\n</p>\n<p>\n    {{ gift_certificate.address }}<br />\n    {% if gift_certificate.address_2 %}\n        {{ gift_certificate.address_2 }}<br />\n    {% endif %}\n    {% if gift_certificate.phone %}\n        {{ gift_certificate.phone }}<br />\n    {% endif %}\n    {{ gift_certificate.city }},&nbsp;{{ gift_certificate.descr_country }},&nbsp;{{ gift_certificate.descr_state }}<br />\n    {{ gift_certificate.zipcode }}\n</p>\n{% endif %}\n\n{% if gift_certificate.message %}\n<div>{{ gift_certificate.message }}</div>\n{% endif %}', 'A', NULL, NULL, 'gift_certificates', 1528699879, 1528699879),
(18, 'products_table', 'gift_certificate_default', NULL, '\n{% if products_table.rows %}\n<table width=\"100%\" cellpadding=\"0\" cellspacing=\"1\" style=\"background-color: #dddddd; -webkit-print-color-adjust: exact;\">\n<thead>\n    <tr>\n\n        {% for  header in products_table.headers %}\n            <th style=\"background-color: #eeeeee; padding: 6px 10px; white-space: nowrap; font-size: 12px; font-family: Arial;\">{{ header }}</th>\n        {% endfor %}\n    </tr>\n</thead>\n<tbody>\n    {% for  row in products_table.rows %}\n        <tr style=\"padding: 10px; background-color: #ffffff; font-size: 12px; font-family: Arial; border: 1px solid #eeeeee; text-align: center;\">\n            {% for  column in row %}\n                <td style=\"border: 1px solid #eeeeee; padding:5px; text-align:left;\">\n                {{ column }}\n                </td>\n            {% endfor %}\n        </tr>\n    {% endfor %}\n</tbody>\n</table>{% endif %}', 'A', '{\"used_table\":\"1\",\"variable_schema\":\"gift_certificate_products_table\"}', '\"fn_gift_certificates_init_product_table_variable\"', 'gift_certificates', 1528699879, 1528699879),
(19, 'bill_to', 'rma_packing_slip_default', NULL, '<h3 style=\" padding: 0px 0px 10px 1px; font-weight: 600; font-size: 15px; font-family: Helvetica, Arial, sans-serif; border-bottom: 1px solid #ededed;\">{{ __(\"bill_to\") }}:</h3>\n                        <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n                            {{ u.b_firstname }} {{ u.b_lastname }}\n                        </p>\n                        <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n                            {{ u.b_address }} {{ u.b_address_2 }}\n                        </p>\n                        <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n                            {{ u.b_city }} {{ u.b_state_descr }} {{ u.b_zipcode }}\n                        </p>\n                        <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">\n                            {{ u.b_country_descr }}\n                        </p>\n                        {% for field in u.b_fields %}\n                        <p style=\"margin: 2px 0px 3px 0px; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ field.name }}: {{ field.value }}\n                        </p>\n                        {% endfor %}', 'A', NULL, NULL, 'rma', 1528699882, 1528699882),
(20, 'company_address', 'rma_packing_slip_default', NULL, '{% set parts = [c.city] %}\n{% if c.state_descr %}\n	{% set parts = parts|merge([c.state_descr]) %}\n{% endif %}\n\n{{ c.address }} <br />\n{{ parts|join(\', \') }} {{ c.zipcode }}  <br />\n{{ c.country_descr }}', 'A', NULL, NULL, 'rma', 1528699882, 1528699882),
(21, 'company_info', 'rma_packing_slip_default', NULL, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n    <tbody>\n        {% if c.phone %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px;  padding-left: 0px; white-space: nowrap;\">{{ __(\"phone1_label\") }}:</td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\">{{ c.phone }}</td>\n        </tr>\n        {% endif %}\n        {% if c.phone_2 %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px;  padding-left: 0px; white-space: nowrap;\">{{ __(\"phone2_label\") }}:</td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\">{{ c.phone_2 }}</td>\n        </tr>\n        {% endif %}\n        {% if c.fax %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px;  padding-left: 0px; white-space: nowrap;\">{{ __(\"fax\") }}:</td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\">{{ c.fax }}</td>\n        </tr>\n        {% endif %}\n        {% if c.website %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px;  padding-left: 0px; white-space: nowrap;\">{{ __(\"web_site\") }}:</td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\">{{ c.website }}</td>\n        </tr>\n        {% endif %}\n        {% if c.orders_department %}\n        <tr valign=\"top\">\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif; text-transform: uppercase; color: #000000; padding-right: 10px;  padding-left: 0px; white-space: nowrap;\">{{ __(\"email\") }}:</td>\n            <td style=\"font-size: 12px; font-family: Helvetica, Arial, sans-serif;\" width=\"100%\"><a href=\"mailto:{{ c.orders_department }}\">{{ c.orders_department_display }}</a></td>\n        </tr>\n        {% endif %}\n    </tbody>\n</table>', 'A', NULL, NULL, 'rma', 1528699882, 1528699882),
(22, 'products_table', 'rma_packing_slip_default', NULL, '<table width=\"100%\" cellpadding=\"0\" cellspacing=\"1\" style=\"border-collapse: separate; border-spacing: 1px; background-color: #dddddd; margin-top: 20px;\">\n\n<thead>\n    <tr>\n\n        {% for  header in products_table.headers %}\n            <th style=\"background-color: #eeeeee; padding: 6px 10px; white-space: nowrap; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ header }}</th>\n        {% endfor %}\n    </tr>\n</thead>\n<tbody>\n    {% for  row in products_table.rows %}\n        <tr>\n            {% for  column in row %}\n                <td style=\"padding: 5px 10px; background-color: #ffffff; font-size: 12px; font-family: Helvetica, Arial, sans-serif;\">{{ column }}</td>\n            {% endfor %}\n        </tr>\n    {% endfor %}\n</tbody>\n</table>', 'A', '{\"used_table\":\"1\",\"variable_schema\":\"rma_packing_slip_products_table\"}', '\"fn_rma_init_snippet_rma_products_table_variable\"', 'rma', 1528699882, 1528699882),
